import React from "react";
import { makeStyles } from "@material-ui/core/styles";
import { Typography, Box } from "@material-ui/core";
import Navbar from "./Navbar";

const useStyles = makeStyles((theme) => ({
  mainContainer: {
    background: "#233",
  },
  timeline: {
    position: "relative",
    padding: "1rem",
    margin: "0 auto",
    "&:before": {
      content: "''", // need double quotes otherwise wont' work?
      position: "absolute",
      height: "100%",
      border: "1px solid tan",
      right: "40px",
      top: 0,
    },
    "&:after": {
      content: "''", // need double quotes otherwise wont' work?
      display: "table",
      clear: "both",
    },
    [theme.breakpoints.up("md")]: {
      // medium screens centered. 960 px
      padding: "2rem",
      "&:before": {
        left: "calc(50% `- 1px)",
        right: "auto",
      },
    },
  },
  timelineYear: {
    textAlign: "center",
    maxWidth: "9.375rem",
    margin: "0 3rem 0 auto",
    fontSize: "1.8rem",
    background: "tomato",
    color: "white",
    lineheight: 1,
    padding: "0.5rem 0 1rem", // differs from his
    "&:before": {
      display: "none",
    },
    [theme.breakpoints.up("md")]: {
      // medium screens centered. 960 px
      textAlign: "center",
      margin: "0 auto",
      // every second element :0
      "&:nth-of-type(2n)": {
        float: "none",
        margin: "0 auto",
      },
      "&:nth-of-type(2n):before": {
        display: "none",
      },
    },
  },
}));

const Resume = () => {
  const classes = useStyles();
  return (
    <>
      <Navbar />
      <Box className={classes.mainContainer} component="header">
        <Typography variant="h4" align="center" style={{ color: "white" }}>
          working experience
        </Typography>
        <Box className={classes.timeline} component="div">
          <Typography
            className={classes.timelineYear}
            variant="h2"
            style={{ color: "white" }}
          >
            2013
          </Typography>
        </Box>
      </Box>
    </>
  );
};

export default Resume;
